import React,{useState,useEffect } from 'react';

export default function Highest(){
    //STATE 
    const [displayData,setDisplayData]=useState([]);

    //EFFECTS 
    useEffect(()=>{
        console.log('useEffect Highest')
        fetch('http://localhost:3000/highest')
        .then(res=>res.json())
        .then(data=>setDisplayData(data))
    })

    //MAP RESPONSE ARRAY 
    const renderHighest=displayData.map()
    //RENDERING 
    return(
        <aside className="highest">
          <h2 className="highest__header">
             Highest-Rated
          </h2>
          <ol className="highest__list">
                {renderHighest}
            </ol>
        </aside>
        )
    }
